import React from 'react'
import { Button } from 'reactstrap'
import { useParams, withRouter, Link } from 'react-router-dom'

const Returnix = () => {
  return (
    <div>
      <h3>vratit na homopage</h3>
    </div>
  )
}

const RouteToHome = withRouter(Returnix)

const Contacts = () => {
  const { path } = useParams()

  return (
    <section>
      <h1>kontakty</h1>
      <hr />
      <hr />
      <h3>prave se nachazite na strance {path}</h3>
      <hr />
      <hr />
      <h4>pomoci LINK</h4>
      <Link to="/">Domu</Link>
      <br />
      <br />
      <hr />
      <hr />
      <RouteToHome />
    </section>
  )
}

export default Contacts
